INSERT INTO `articles` VALUES (170,'Cuomo Seeks Cut in Frisk Arrests','http://www.nytimes.com/2012/06/04/nyregion/cuomo-seeks-cut-in-stop-and-frisk-arrests.html','Gov. Andrew M. Cuomo plans to ask legislators for a change in New York State law that would drastically reduce the number of people who could be arrested for marijuana possession as a result of police stops.',1,'2012-06-04 03:35:13','2012-06-04 18:21:28'),(229,'Brash Chef and Big Bet for CNN','http://www.nytimes.com/2012/06/04/business/media/cnn-hires-bourdain-in-a-bet-on-lifting-stalled-ratings.html','CNN Worldwide, suffering poor ratings, is taking a chance on Anthony Bourdain’s cocky persona with a new travel-and-food show.',1,'2012-06-03 23:47:56','2012-06-04 18:21:32'),(298,'In a Skirmish to Control the Screens','http://bits.blogs.nytimes.com/2012/06/03/xbox-gives-microsoft-a-head-start-in-the-battle-for-every-screen/','Tech companies are in a pitched battle for dominance of the three screens: smartphones, tablets and televisions - especially televisions. And the least likely competitor, Microsoft, may be the farthest along. ',1,'2012-06-03 15:00:24','2012-06-04 18:21:36'),(420,'Dreaming of a Superhero','http://www.nytimes.com/2012/06/03/opinion/sunday/dowd-dreaming-of-a-superhero.html','As funnel clouds form over Washington, Obama still seems absorbed in his endless odyssey of self-discovery.',1,'2012-06-02 20:51:15','2012-06-04 18:21:45'),(447,'Salt, We Misjudged You','http://www.nytimes.com/2012/06/03/opinion/sunday/we-only-think-we-know-the-truth-about-salt.html','Salt in the diet should be avoided, right? No, not really.',1,'2012-06-02 20:13:16','2012-06-04 18:21:48'),(468,'Lawsuit Shakes Foundation of a Man’s World of Tech','http://www.nytimes.com/2012/06/03/technology/lawsuit-against-kleiner-perkins-is-shaking-silicon-valley.html','A sexual discrimination lawsuit by Ellen Pao at the venture capital firm Kleiner Perkins has prompted wider discussion about the treatment of women in the tech world.',1,'2012-06-02 18:49:15','2012-06-04 18:21:49'),(515,'Twitter Dynamos, Offering Word of God’s Love','http://www.nytimes.com/2012/06/02/technology/christian-leaders-are-powerhouses-on-twitter.html','Twitter is courting Christian evangelical leaders, who have found the network to be surprisingly effective for building influence and spreading inspiration far and wide.',1,'2012-06-02 04:49:43','2012-06-04 18:21:54'),(624,'Andy Samberg Confirms He\'s Leaving \'Saturday Night Live\'','http://artsbeat.blogs.nytimes.com/2012/06/01/andy-samberg-confirms-hes-leaving-saturday-night-live/','Andy Samberg, who helped pioneer the popular \"Saturday Night Live\" digital shorts like \"Lazy Sunday,\" \"I\'m on a Boat\" and \"I Just Had Sex,\" said that leaving the show was \"one of the hardest decisions I\'ve ever made.\" ',1,'2012-06-01 22:51:37','2012-06-04 18:22:03'),(680,'The Science of ‘Gaydar’','http://www.nytimes.com/2012/06/03/opinion/sunday/the-science-of-gaydar.html','Can we really detect others’ sexual orientation from mere observation? Absolutely.',1,'2012-06-01 20:58:45','2012-06-04 18:22:06'),(778,'32 Innovations That Will Change Your Tomorrow','http://www.nytimes.com/interactive/2012/06/03/magazine/innovations-issue.html','An abridged guide to the many ways that your day is about to get better.',1,'2012-06-01 17:59:22','2012-06-04 18:22:14'),(816,'American Nuns Vow to Fight Vatican Criticism','http://www.nytimes.com/2012/06/02/us/nuns-speak-about-vatican-criticism.html','After being condemned as failing to uphold Catholic doctrine, the sisters are sending representatives to Rome to speak with Vatican officials.',1,'2012-06-01 16:26:20','2012-06-04 18:22:17'),(958,'Obama Order Sped Up Wave of Cyberattacks Against Iran','http://www.nytimes.com/2012/06/01/world/middleeast/obama-ordered-wave-of-cyberattacks-against-iran.html','Even after the Stuxnet computer worm became public, President Obama accelerated cyberattacks against Iran that had begun in the Bush administration, temporarily disabling 1,000 centrifuges.',1,'2012-06-01 06:30:17','2012-06-04 18:22:32'),(1005,'On Facebook, ‘Likes’ Become Ads','http://www.nytimes.com/2012/06/01/technology/so-much-for-sharing-his-like.html','Many companies pay Facebook to generate ads when users click to “like” their brands or reference them in some other way.',1,'2012-06-01 02:43:18','2012-06-04 18:22:36'),(1047,'The Austerity Agenda','http://www.nytimes.com/2012/06/01/opinion/krugman-the-austerity-agenda.html','In America and in Britain, the push for austerity is not really about debt and deficits. It’s about using deficit panic as an excuse to dismantle social programs.',1,'2012-06-01 01:06:25','2012-06-04 18:22:40'),(1129,'Transition','http://video.nytimes.com/video/2012/05/31/opinion/100000001579773/transition.html','The filmmaker Zina Saro-Wiwa presents an Op-Doc on black women’s decision to embrace their naturally kinky hair, rather than use chemical straighteners.',1,'2012-05-31 21:11:49','2012-06-04 18:22:46'),(1130,'Black Women’s Transitions to Natural Hair','http://www.nytimes.com/2012/06/01/opinion/black-women-and-natural-hair.html','A video on black women’s decision to embrace their naturally kinky hair, rather than use chemical straighteners.',1,'2012-05-31 21:11:44','2012-06-04 18:22:46'),(1381,'New York Plans to Ban Sale of Big Sizes of Sugary Drinks','http://www.nytimes.com/2012/05/31/nyregion/bloomberg-plans-a-ban-on-large-sugared-drinks.html','A proposal that would take effect as soon as next March is the most ambitious effort yet by Mayor Michael R. Bloomberg’s administration to combat rising obesity.',1,'2012-05-31 02:00:36','2012-06-04 18:23:08'),(1416,'You Can Go Home Again','http://www.nytimes.com/2012/05/31/opinion/the-parent-trap.html','Research shows that the closer bonds between young adults and their parents should be celebrated, and do not necessarily compromise the independence of the next generation.',1,'2012-05-31 00:26:06','2012-06-04 18:23:10'),(1427,'A Hybrid That Runs on Foot Power and Beer','http://www.nytimes.com/2012/05/31/world/europe/from-amsterdam-beer-bikes-popularity-spreads.html','A kind of pub on wheels, the beer bike has grown in popularity, spreading beyond the Dutch border to other European countries and the United States.',1,'2012-05-30 23:30:59','2012-06-04 18:23:11'),(1491,'For Some, Exercise May Increase Heart Risk','http://well.blogs.nytimes.com/2012/05/30/can-exercise-be-bad-for-you/','Researchers have found evidence that some people who exercise do worse on measures related to heart disease. ',1,'2012-05-30 21:00:05','2012-06-04 18:23:16'),(1572,'A Gap in College Graduates Leaves Some Cities Behind','http://www.nytimes.com/2012/05/31/us/as-college-graduates-cluster-some-cities-are-left-behind.html','Cities that once depended on manufacturing jobs are finding it hard to compete with already highly educated areas for college graduates, a key ingredient in a transformation.',1,'2012-05-30 17:18:53','2012-06-04 18:23:23'),(1635,'When Technology Works, It Seems Like Magic','http://pogue.blogs.nytimes.com/2012/05/30/when-technology-works-it-seems-like-magic/','David Pogue had a problem: retrieving a file off his home computer on the other side of the Atlantic. With the help of a V.P.N. and Dropbox, he did it in minutes. ',1,'2012-05-30 12:25:07','2012-06-04 18:23:27'),(1644,'Fiona Apple Faces Outward','http://www.nytimes.com/2012/06/03/arts/music/fiona-apples-new-album-the-idler-wheel.html','Her songs have built Fiona Apple, whose new album is partly titled “The Idler Wheel,” an audience that follows her intently, with both admiration and concern.',1,'2012-05-30 12:00:40','2012-06-04 18:23:29'),(1733,'How China Flouts Its Laws','http://www.nytimes.com/2012/05/30/opinion/how-china-flouts-its-laws.html','The fundamental question the Chinese government must face is lawlessness. China does not lack laws, but rather the rule of law.',1,'2012-05-30 03:42:03','2012-06-04 18:31:52'),(1753,'Wasting Time Is New Divide in Digital Era','http://www.nytimes.com/2012/05/30/us/new-digital-divide-seen-in-wasting-time-online.html','As access to devices has spread, children in poorer families are spending considerably more time using them for purposes other than for education.',1,'2012-05-30 02:16:44','2012-06-04 18:31:54'),(1800,'Doc Watson, Blind Guitar Wizard Who Influenced Generations, Dies at 89','http://www.nytimes.com/2012/05/30/arts/music/doc-watson-folk-musician-dies-at-89.html','Mr. Watson’s flat-picking style elevated the acoustic guitar to solo status in bluegrass and country music, and his interpretations of traditional American music influenced generations of guitarists.',1,'2012-05-30 00:30:48','2012-06-04 18:31:57'),(1860,'Bob Dylan Among Recipients of Presidential Medal of Freedom','http://artsbeat.blogs.nytimes.com/2012/05/29/bob-dylan-among-recipients-of-presidential-medal-of-freedom/','Bob Dylan was praised by President Obama and presented with a Medal of Freedom at the White House on Tuesday, alongside other honorees who included Toni Morrison, Madeleine K. Albright, John Paul Stevens, John Glenn and Shimon Peres. ',1,'2012-05-29 20:24:44','2012-06-04 18:32:01'),(1934,'Young and Global Need Not Apply in Japan','http://www.nytimes.com/2012/05/30/business/global/as-global-rivals-gain-ground-corporate-japan-clings-to-cautious-ways.html','Critics say the reluctance of businesses to hire Western-educated graduates who return to the homeland hurts some of Japan’s increasingly globalized industries.',1,'2012-05-29 16:42:03','2012-06-04 18:32:07'),(2015,'Your Veil Is a Battleground','http://lens.blogs.nytimes.com/2012/05/29/your-veil-is-a-battleground/','Kiana Hayeri returned to her native Iran a few years ago to explore the dual lives of women. Facing restrictions on how they look and act in public, they embrace a rebellious impulse in private. \"This is the generation that is trying to push the boundaries in every sense.\" ',1,'2012-05-29 09:00:58','2012-06-04 18:32:13'),(2021,'Secret ‘Kill List’ Proves a Test of Obama’s Principles and Will','http://www.nytimes.com/2012/05/29/world/obamas-leadership-in-war-on-al-qaeda.html','President Obama has placed himself at the helm of a top secret process to designate terrorists for kill or capture, reserving the final say on approving lethal action, say current and former aides.',1,'2012-05-29 06:40:47','2012-06-04 18:32:14'),(2053,'Dewey & LeBoeuf Files for Bankruptcy','http://dealbook.nytimes.com/2012/05/28/dewey-leboeuf-files-for-bankruptcy/','The bankruptcy filing is the final chapter in a turbulent period for the law firm, which unraveled after disappointing profits and prodigious debt forced it to slash partners\' salaries. ',1,'2012-05-29 02:23:47','2012-06-04 18:32:16'),(2113,'Look Now for Venus to Cross the Sun, or Wait Another Century','http://www.nytimes.com/2012/05/29/science/space/venuss-transit-between-earth-and-sun-will-be-last-until-2117.html','While no longer of great scientific import, a Venus transit is still a rare and striking event, occurring in pairs, eight years apart, about once a century.',1,'2012-05-28 22:36:13','2012-06-04 18:32:20'),(2154,'The Enigma 1,800 Miles Below Us','http://www.nytimes.com/2012/05/29/science/earths-core-the-enigma-1800-miles-below-us.html','New research suggests the existing models of Earth’s core may not explain its complexities.',1,'2012-05-28 19:27:24','2012-06-04 18:32:23'),(2220,'A Picture Book Without Pictures','http://lens.blogs.nytimes.com/2012/05/28/a-picture-book-without-pictures/','\"Photographs Not Taken,\" published by Daylight, is a collection of essays in which photographers discuss why a photo eluded them, or why they decided not to take it. ',1,'2012-05-28 09:00:49','2012-06-04 18:32:29'),(2343,'For Tech Start-Ups, New York Has Increasing Allure','http://www.nytimes.com/2012/05/28/technology/for-tech-startups-new-york-has-increasing-allure.html','New York may not be overtaking the Bay Area as a technology hub, but it is becoming enough of an alternative that a few West Coast-born startups are moving east.',1,'2012-05-27 18:01:13','2012-06-04 18:32:39'),(2344,'Facebook Tries, Tries Again on a Smartphone','http://bits.blogs.nytimes.com/2012/05/27/facebook-tries-tries-again-on-a-smartphone/','Can a software company build its own smartphone? We may well find out soon. This past week, Google completed its acquisition of the hardware maker Motorola Mobility for $12.5 billion, which could lead to the search giant\'s making its own smartphone. But another software titan might be getting into the hardware game as well: Facebook. ',1,'2012-05-27 17:53:43','2012-06-04 18:32:39'),(2470,'Obama Should Seize the High Ground','http://www.nytimes.com/2012/05/27/opinion/sunday/friedman-president-obama-should-seize-the-high-ground.html','President Obama has quite a record of accomplishment to run on for re-election if he would only run on it.',1,'2012-05-26 21:01:37','2012-06-04 18:32:48'),(2474,'This Is How We Ride','http://www.nytimes.com/2012/05/27/opinion/sunday/this-is-how-we-ride.html','Bikes can transform our world and make it better. New Yorkers are about to see how.',1,'2012-05-26 21:00:32','2012-06-04 18:32:48'),(2481,'Let’s Be Less Productive','http://www.nytimes.com/2012/05/27/opinion/sunday/lets-be-less-productive.html','The relentless drive for productivity may have some limits; if our economies don’t continue to expand, we risk putting people out of work.',1,'2012-05-26 20:48:39','2012-06-04 18:32:49'),(2504,'Do the Jews Own Anxiety?','http://opinionator.blogs.nytimes.com/2012/05/26/do-the-jews-own-anxiety/','What Woody Allen, Philip Roth and nearly 6,000 years of collective memory have wrought. ',1,'2012-05-26 19:00:31','2012-06-04 18:32:51'),(2520,'The Hunch, the Pounce and the Kill','http://www.nytimes.com/2012/05/27/business/how-boaz-weinstein-and-hedge-funds-outsmarted-jpmorgan.html','JPMorgan Chase lost big because of outsize trades, but not before Boaz Weinstein, a hedge fund manager, seized a rich opportunity, winning in a high-risk game of nerves.',1,'2012-05-26 17:45:43','2012-06-04 18:32:51'),(2532,'With Personal Data in Hand, Thieves File Early and Often','http://www.nytimes.com/2012/05/27/us/id-thieves-loot-tax-checks-filing-early-and-often.html','Criminals filing false tax returns with made-up incomes have received hundreds of millions of dollars in refunds, law enforcement officials say.',1,'2012-05-26 16:29:37','2012-06-04 18:32:52'),(2628,'Drug for Adults Is Popular as Children’s Remedy','http://www.nytimes.com/2012/05/26/us/miralax-a-popular-cure-but-never-approved-for-children.html','Parents are questioning the long-term effects of the often-used laxative, Miralax, which has become a staple in many American households since it was first introduced 13 years ago.',1,'2012-05-26 01:39:22','2012-06-04 18:33:00'),(2637,'Facebook’s Brilliant Disaster','http://www.nytimes.com/2012/05/26/opinion/nocera-facebooks-brilliant-disaster.html','For once, the benefits of an I.P.O. went to the company instead of to Wall Street.',1,'2012-05-26 01:24:53','2012-06-04 18:33:00'),(2655,'Plantations, Prisons and Profits','http://www.nytimes.com/2012/05/26/opinion/blow-plantations-prisons-and-profits.html','Louisiana’s for-profit prisons are an abomination. A series by The Times-Picayune of New Orleans paints a picture of convicts as chattel and a legal system based on human commodification.',1,'2012-05-26 00:45:55','2012-06-04 18:33:02'),(2677,'One More Reason to Fear the Beach','http://tv.nytimes.com/2012/05/26/arts/television/mermaids-the-body-found-on-animal-planet.html','The film “Mermaids: The Body Found,” on Animal Planet, takes on the feel of “The Blair Witch Project” as it hunts down the title creatures.',1,'2012-05-25 23:32:10','2012-06-04 18:33:03'),(2764,'Now Coveted: A Walkable, Convenient Place','http://www.nytimes.com/2012/05/27/opinion/sunday/now-coveted-a-walkable-convenient-place.html','Today, the most valuable real estate lies in walkable and bikable urban locations.',1,'2012-05-25 19:57:16','2012-06-04 18:33:11'),(2817,'How I Fell for Lisbon','http://travel.nytimes.com/2012/05/27/travel/how-i-fell-for-lisbon.html','I didn’t expect romance, but this city had other ideas. No must-see list or hard-fought reservations. It lets you in.',1,'2012-05-25 17:29:03','2012-06-04 18:33:14'),(2834,'As Memorial Day Nears, a Single Image That Continues to Haunt','http://atwar.blogs.nytimes.com/2012/05/25/as-memorial-day-nears-a-single-image-that-continues-to-haunt/','A bereaved wife lies near her husband\'s coffin as a Marine stands by. Todd Heisler\'s image of Katherine Cathey continues to stir military and veteran wives seven years after it was taken. ',1,'2012-05-25 16:38:44','2012-06-04 18:33:16'),(2842,'A Company’s Stand for Gay Marriage, and Its Cost','http://www.nytimes.com/2012/05/26/business/replacements-limiteds-stand-for-gay-marriage-draws-repercussions.html','Replacements Limited, of North Carolina, lost customers and got a lot of hate mail when it and its founder urged voters to reject a gay marriage ban.',1,'2012-05-25 16:04:15','2012-06-04 18:33:17'),(2903,'John Waters Tries Some Desperate Living on a Cross-Country Hitchhiking Odyssey','http://artsbeat.blogs.nytimes.com/2012/05/25/john-waters-tries-some-desperate-living-on-a-cross-country-hitchhiking-odyssey/','John Waters, the director of \"Hairspray,\" \"Polyester\" and \"Pink Flamingos,\" recounts his hitchhiking experiences from a recent road trip as he collected material for a book he plans to call \"Carsick.\" ',1,'2012-05-25 13:00:51','2012-06-04 18:33:22'),(2976,'Battle Brewing Over Labeling of Genetically Modified Food','http://www.nytimes.com/2012/05/25/science/dispute-over-labeling-of-genetically-modified-food.html','Concern over the possible health and environmental effects of such food has prompted a move for labeling it, but scientists, farmers and technology companies call the measures alarmist.',1,'2012-05-25 03:49:58','2012-06-04 18:33:27'),(3034,'The Service Patch','http://www.nytimes.com/2012/05/25/opinion/brooks-the-service-patch.html','As college graduates consider their career prospects, they should think about how to be as much as they think about what to be.',1,'2012-05-25 01:24:17','2012-06-04 18:33:32'),(3038,'Egos and Immorality','http://www.nytimes.com/2012/05/25/opinion/krugman-egos-and-immorality.html','It has been almost funny to see how thin-skinned the Masters of the Universe really are as the role of Wall Street is debated by politicians.',1,'2012-05-25 01:17:13','2012-06-04 18:33:32'),(3235,'Facebook Releases a Photocentric App for Apple Devices','http://bits.blogs.nytimes.com/2012/05/24/facebook-releases-a-photocentric-app-for-apple-devices/','Facebook announced a new application called Facebook Camera for the Apple iPhone and iPod Touch, which is intended to make it easier to take pictures and share them on Facebook. Dirk Stoop, a Facebook product manager for photos, said that the application was much faster than the current Facebook app for Apple\'s iOS. ',1,'2012-05-24 17:00:13','2012-06-04 18:33:47'),(3292,'A Jennifer Egan Original ... Tweet by Tweet','http://mediadecoder.blogs.nytimes.com/2012/05/24/a-jennifer-egan-original-tweet-by-tweet/','The Pulitzer Prize-winning author has a new short story for the New Yorker that will roll out first on Twitter, one tweet at a time. ',1,'2012-05-24 13:00:58','2012-06-04 18:33:51'),(3316,'Man Confesses to Strangling Etan Patz, Police Say','http://cityroom.blogs.nytimes.com/2012/05/24/man-claims-role-in-disappearance-of-etan-patz-police-say/','New York authorities are investigating the claims of a man who has told investigators that he had a role in the 1979 disappearance of Etan Patz, the 6-year-old boy who vanished in SoHo on his way to school and is believed to have been murdered, officials said on Thursday. ',1,'2012-05-24 11:18:26','2012-06-04 18:33:53'),(3334,'How Did Wisconsin Become the Most Politically Divisive Place in America?','http://www.nytimes.com/2012/05/27/magazine/how-did-wisconsin-become-the-most-politically-divisive-place-in-america.html','Scott Walker, Scott Fitzgerald and the coming recall vote in the land of cheese and rancor.',1,'2012-05-24 09:00:10','2012-06-04 18:33:55'),(3357,'New Orleans Paper Said to Face Deep Cuts and May Cut Back Publication','http://mediadecoder.blogs.nytimes.com/2012/05/23/new-orleans-paper-said-to-face-deep-cuts-and-may-cut-back-on-publication/','The New Orleans Times-Picayune survived Hurricane Katrina, but its owner, Newshouse Newspapers, appears to be ending its run as the sole daily newspaper in New Orleans. ',1,'2012-05-24 03:33:08','2012-06-04 18:33:56'),(3414,'Our Not-So-Friendly Northern Neighbor','http://www.nytimes.com/2012/05/24/opinion/our-not-so-friendly-northern-neighbor.html','Quebec is trampling basic democratic rights in order to end student protests against tuition increases.',1,'2012-05-24 00:49:37','2012-06-04 18:34:00'),(3586,'When a Boy Found a Familiar Feel in a Pat of the Head of State','http://www.nytimes.com/2012/05/24/us/politics/indelible-image-of-a-boys-pat-on-obamas-head-hangs-in-white-house.html','A photograph of a young black boy feeling President Obama’s hair has been on view in the West Wing for years.',1,'2012-05-23 15:50:28','2012-06-04 18:34:15'),(3619,'Hey, How Did You Find That Place?','http://travel.nytimes.com/2012/05/27/travel/six-sites-that-curate-lodging-options-so-you-dont-have-to.html','If your tastes are more boutique than mainstream, these sites could help streamline your search for a special place to stay.',1,'2012-05-23 14:02:10','2012-06-04 18:34:18'),(3659,'Mommy Wars: The Prequel','http://www.nytimes.com/2012/05/27/magazine/ina-may-gaskin-and-the-battle-for-at-home-births.html','Ina May Gaskin, the original home-birth evangelist, is finally winning converts in the mainstream.',1,'2012-05-23 11:00:09','2012-06-04 18:34:25'),(3663,'An Open Letter to India\'s Graduating Classes','http://in