ng Loss Is Said to Rise at Least 50%','http://dealbook.nytimes.com/2012/05/16/jpmorgans-trading-loss-is-said-to-rise-at-least-50/','The deterioration of the bank\'s position accelerated in the last four trading days as investors took advantage of its distress. ',1,'2012-05-17 01:14:05','2012-06-04 18:37:15'),(5634,'A Judge’s Plea for Pot','http://www.nytimes.com/2012/05/17/opinion/a-judges-plea-for-medical-marijuana.html','For cancer patients, marijuana is a medical and a human rights issue. New York should pass the medical marijuana bill this year.',1,'2012-05-17 00:16:54','2012-06-04 18:37:16'),(5680,'Popular Antibiotic May Raise Risk of Sudden Death','http://www.nytimes.com/2012/05/17/health/research/popular-antibiotic-may-raise-risk-of-sudden-death.html','Azithromycin may be risky for adults with heart problems, a new study finds, by possibly causing abnormal, potentially fatal, heart rhythms.',1,'2012-05-16 22:43:21','2012-06-04 18:37:20'),(5685,'Doubt Cast on the ‘Good’ in ‘Good Cholesterol’','http://www.nytimes.com/2012/05/17/health/research/hdl-good-cholesterol-found-not-to-cut-heart-risk.html','People genetically prone to higher levels of HDL, often called “good cholesterol,” showed that they did not have any significant decrease in risk of cardiovascular disease.',1,'2012-05-16 22:31:10','2012-06-04 18:37:21'),(5724,'Trayvon Martin Case Shadowed by Series of Police Missteps','http://www.nytimes.com/2012/05/17/us/trayvon-martin-case-shadowed-by-police-missteps.html','Mistakes by the Police Department in Sanford, Fla., and circumstances beyond its control, could make it more difficult to pursue a case against George Zimmerman.',1,'2012-05-16 21:18:33','2012-06-04 18:37:24'),(5726,'The Riddle of Gay Marriage Polling','http://douthat.blogs.nytimes.com/2012/05/16/the-riddle-of-gay-marriage-polling/','A new survey sheds some light on the subject. ',1,'2012-05-16 21:09:07','2012-06-04 18:37:24'),(5729,'Coffee Drinkers May Live Longer','http://well.blogs.nytimes.c