iness/federal-report-cites-bank-officials-in-foreclosure-surge.html','An extensive federal examination of banks’ foreclosure practices found that managers ignored widespread errors after the 2008 housing market collapse.',1,'2012-03-12 16:44:44','2012-06-04 19:14:21'),(26487,'#StopKONY Now!!!','http://www.nytimes.com/2012/03/13/opinion/cohen-stop-kony-now.html','A superficial movie about an African war criminal goes viral, and that on balance is a good thing.',1,'2012-03-12 14:37:27','2012-06-04 19:14:26'),(26542,'CNN Is Said to Be in Talks to Acquire Mashable','http://mediadecoder.blogs.nytimes.com/2012/03/12/cnn-in-talks-to-acquire-mashable-sources-say/','CNN, a unit of Time Warner, and Mashable are in advanced talks that may lead to an acquisition of the social news Web site, three people briefed on the talks said. ',1,'2012-03-12 08:05:51','2012-06-04 19:14:32'),(26558,'The Reproduction of Privilege','http://campaignstops.blogs.nytimes.com/2012/03/12/the-reproduction-of-privilege/','As college loses its postwar role as a social and economic equalizer, the political implications are profound. ',1,'2012-03-12 04:31:30','2012-06-04 19:14:33'),(26628,'Wily, Elusive Foragers Invade Upstate New York','http://www.nytimes.com/2012/03/12/nyregion/feral-pigs-plaguing-upstate-new-york.html','Feral pigs, known as eating machines in the South and West, are now troubling farms in New York’s Champlain Valley, devouring crops and prey.',1,'2012-03-12 00:07:58','2012-06-04 19:14:43'),(26717,'U.S. Sergeant Is Said to Kill 16 Civilians in Afghanistan','http://www.nytimes.com/2012/03/12/world/asia/afghanistan-civilians-killed-american-soldier-held.html','Nine children were among the dead after an American soldier stalked from home to home in attacks in a rural stretch of southern Afghanistan, Afghan and American officials said.',1,'2012-03-11 07:03:55','2012-06-04 19:14:52'),(26780,'Centrist Women Tell of Disenchantment With Republicans','http://www.nytimes.com/2012/03/11/us/politi