op of H.P. TouchPad, an Object Lesson for the Tech Sector','http://www.nytimes.com/2012/01/02/technology/hewlett-packards-touchpad-was-built-on-flawed-software-some-say.html','WebOS, the TouchPad tablet’s core software, was developed by Palm in about nine months, and former employees said the software was deeply flawed because of the way it was built.',1,'2012-01-01 22:37:16','2012-06-04 20:02:26'),(49485,'Google Bases a Campaign on Emotions, Not Terms','http://www.nytimes.com/2012/01/02/technology/google-hones-its-advertising-message-playing-to-emotions.html','The company is embracing advertising and promoting new businesses like the Chrome browser and the Google Plus social network in order to find revenue beyond search ads.',1,'2012-01-01 22:12:50','2012-06-04 20:02:26'),(49488,'On Modern Time','http://opinionator.blogs.nytimes.com/2012/01/01/on-modern-time/','Even in this frenetic age, we can experience our lives beyond the limitations of the calendar and the clock. ',1,'2012-01-01 22:00:25','2012-06-04 20:02:27'),(49513,'Disruptions: Resolved in 2012: To Enjoy the View Without Help From an iPhone','http://bits.blogs.nytimes.com/2012/01/01/resolved-in-2012-to-enjoy-the-view-without-help-from-an-iphone/','Last week, I climbed a rocky hill south of San Francisco at sunset and spent 10 minutes trying to compose the perfect shot on my iPhone. I was watching a magnificent sunset through a tiny four-inch screen. In the new year, I resolve to take a break from technology and let my brain do a little wandering on its own. ',1,'2012-01-01 18:42:27','2012-06-04 20:02:31'),(49514,'Romney Fights for First-Place Showing in Iowa Caucuses','http://www.nytimes.com/2012/01/02/us/politics/focus-on-electability-as-caucuses-near.html','Just as confidence had been rising among Mitt Romney and his aides that they could pull off a win in Iowa, Rick Santorum emerged as the latest in a rotating cast of surging alternatives.',1,'2012-01-01 18:38:19','2012-06-04 20:02:31'),(49521,'In Iowa