-harbor.html','The strange second life of a Michigan factory town that lost its factories.',1,'2011-12-15 16:38:17','2012-06-04 20:12:00'),(54064,'Walkouts by Nurses Loom as Hospitals Seek to Cut Costs','http://www.nytimes.com/2011/12/16/nyregion/nurses-threaten-strike-at-3-new-york-hospitals.html','The specter of nursing strikes is looming on both coasts, with more than 6,000 nurses poised to walk out of three prestigious hospitals in New York City.',1,'2011-12-15 16:20:16','2012-06-04 20:12:02'),(54100,'Your Life on Facebook, in Total Recall','http://www.nytimes.com/2011/12/16/technology/facebook-brings-back-the-past-with-new-design.html','The social network is rolling out a revamped profile feature called Timeline that makes a user’s entire history of photos, links and other items much more accessible with a single click.',1,'2011-12-15 14:38:59','2012-06-04 20:12:05'),(54160,'In Baghdad, Panetta Leads Uneasy Moment of Closure','http://www.nytimes.com/2011/12/16/world/middleeast/panetta-in-baghdad-for-iraq-military-handover-ceremony.html','The military is departing a country where insurgents continue to attack American soldiers and militants with Al Qaeda still regularly carry out devastating attacks against civilians.',1,'2011-12-15 09:28:56','2012-06-04 20:12:12'),(54179,'As Doctors Use More Devices, Potential for Distraction Grows','http://www.nytimes.com/2011/12/15/health/as-doctors-use-more-devices-potential-for-distraction-grows.html','Some hospitals have begun limiting the use of computers, smartphones and other devices in critical settings.',1,'2011-12-15 04:45:32','2012-06-04 20:12:15'),(54219,'George Whitman, Paris Bookseller and Cultural Beacon, Is Dead at 98','http://www.nytimes.com/2011/12/15/books/george-whitman-paris-bookseller-and-cultural-beacon-is-dead-at-98.html','Mr. Whitman, the American-born owner of Shakespeare & Company in Paris, believed that “the book business is the business of life.”',1,'2011-12-15 02:43:24','2012-06-04 20:12:20'),(542