','http://www.nytimes.com/2011/03/19/us/19twitter.html','The tantalizing window Twitter provides on the lives of friends, colleagues, rivals and celebrities can have a downside: knowing too much about the fun you are missing.',1,'2011-03-19 04:41:34','2012-06-04 20:41:28'),(67649,'Obama Takes Hard Line With Libya After Shift by Clinton','http://www.nytimes.com/2011/03/19/world/africa/19policy.html','With Col. Muammar el-Qaddafi’s forces turning back the rebellion that threatened his rule, Secretary of State Hillary Rodham Clinton came out for military action.',1,'2011-03-19 01:32:29','2012-06-04 20:41:30'),(67720,'Satellite Photos of Japan, Before and After the Quake and Tsunami','http://www.nytimes.com/interactive/2011/03/13/world/asia/satellite-photos-japan-before-and-after-tsunami.html','Compare satellite images of areas of Japan before and after the disaster.',1,'2011-03-13 05:00:00','2012-06-04 20:41:39'),(67723,'Powerful Quake and Tsunami Devastate Northern Japan','http://www.nytimes.com/2011/03/12/world/asia/12japan.html','Japan was filled with scenes of desperation a day after an 8.9-magnitude quake, as survivors called for help and rescuers looked for people buried in rubble.',1,'2011-03-12 05:00:00','2012-06-04 20:41:39'),(67726,'Updates on the Earthquake and Tsunami in Japan','http://thelede.blogs.nytimes.com/2011/03/11/video-of-the-earthquake-and-tsunami-in-japan/','Television networks across the world carried dramatic footage, some of it live, of the tsunami that hit northern Japan. ',1,'2011-03-11 05:00:00','2012-06-04 20:41:39'),(67730,'A Glow in the Desert','http://www.nytimes.com/2011/03/10/garden/10texas.html','A former Manhattanite decamped to a 60-acre tract deep in West Texas where he lives off the grid, like a modern-day Thoreau.',1,'2011-03-10 05:00:00','2012-06-04 20:41:40'),(67740,'Mapping the Nation’s Well-Being','http://www.nytimes.com/interactive/2011/03/06/weekinreview/20110306-happiness.html','Americans’ health, well-being and happiness.',1,'2011-03-06 05:00:00','2012-06-04 20:41:42'),(67758,'Natalie Portman, Oscar Winner, Was Also a Precocious Scientist','http://www.nytimes.com/2011/03/01/science/01angier.html','Natalie Portman is one of a handful of stars who have serious scientific credentials.',1,'2011-02-28 20:18:47','2012-06-04 20:41:43'),(67786,'Secrets of a Mind-Gamer','http://www.nytimes.com/interactive/2011/02/20/magazine/mind-secrets.html','How I trained my brain and became a world-class memory athlete.',1,'2011-02-20 05:00:00','2012-06-04 20:41:48'),(67842,'Federal Research Center Will Help Develop Medicines','http://www.nytimes.com/2011/01/23/health/policy/23drug.html','The Obama administration has become so concerned about the slowing pace of new drugs coming out of the pharmaceutical industry that officials have decided to start a billion-dollar government center to help create medicines.',1,'2011-01-23 05:00:00','2012-06-04 20:41:55'),(67849,'Video Captured ‘Calculated’ Gunman in Tucson','http://www.nytimes.com/2011/01/19/us/19giffords.html','Video from a store security camera shows the attack on Representative Gabrielle Giffords and Judge John M. Roll.',1,'2011-01-19 02:11:32','2012-06-04 20:41:55'),(67864,'Missing the Fragrance of Everyday Life','http://lens.blogs.nytimes.com/2011/01/12/missing-the-fragrance-of-everyday-lif/','Pavia Rosati is the second of 10 New Yorkers Beatrice de Gea has portrayed for The Times in a series of impressionistic diptychs. ',1,'2011-01-12 10:00:47','2012-06-04 20:41:57'),(67867,'Why So Many Rich People Don\'t Feel Very Rich','http://economix.blogs.nytimes.com/2011/01/11/why-so-many-rich-people-dont-feel-very-rich/','It\'s because they\'re trying to keep up with impossibly richer Joneses. Inequality is much greater at the top of the income distribution than in the middle or bottom. ',1,'2011-01-11 05:00:00','2012-06-04 20:41:57'),(67873,'Nutrition Advice From the China Study','http://well.blogs.nytimes.com/2011/01/07/nutrition-advice-from-the-china-