 Researching malaria and creating an installation to educate the school community. ',1,'2010-02-24 05:00:00','2012-06-04 20:42:39'),(68171,'Evidence That Little Touches Do Mean So Much','http://www.nytimes.com/2010/02/23/health/23mind.html','New research analyzed physical contact to see whether a rich vocabulary of supportive touch is in fact related to performance.',1,'2010-02-23 05:00:00','2012-06-04 20:42:39'),(68172,'Dysfunction Function: Charting the Ideal and Real Legislative Process','http://learning.blogs.nytimes.com/2010/02/23/dysfunction-function-charting-the-ideal-and-real-legislative-process/','Lesson Plan &#124; Comparing the basic legislative process with the real process, complete with the political machinations at work when a bill works its way through Congress. ',1,'2010-02-23 05:00:00','2012-06-04 20:42:39'),(68270,'Fun and Games: Solving Math Puzzles','http://learning.blogs.nytimes.com/2009/10/26/fun-and-games-solving-math-puzzles/','Lesson Plan &#124; Solving puzzles for fun and learning. ',1,'2009-10-26 04:00:00','2012-06-04 20:42:51'),(68294,'Good Night and Tough Luck','http://niemann.blogs.nytimes.com/2009/09/14/good-night-and-tough-luck/','Between hypochondria and mosquitoes, sleep can be elusive. ',1,'2009-09-14 04:00:00','2012-06-04 20:42:54'),(68302,'The Women’s Crusade','http://www.nytimes.com/2009/08/23/magazine/23Women-t.html','The liberation of women could help solve many of the world’s problems, from poverty to child mortality to terrorism.',1,'2009-08-23 04:00:00','2012-06-04 20:42:57'),(68307,'A Billion Teenagers, for Better or Worse','http://dotearth.blogs.nytimes.com/2009/08/12/a-billion-teenagers-for-better-or-worse/','Some of the world\'s poorest and most turbulent regions are witnessing explosive population growth, meaning enormous numbers of teenagers and children. ',1,'2009-08-12 04:00:00','2012-06-04 20:42:57'),(68312,'Gauging Your Distraction','http://www.nytimes.com/interactive/2009/07/19/technology/20090719-driving-game.html','A game illustrates the potential consequences of distractions like texting on your driving ability.',1,'2009-07-19 04:00:00','2012-06-04 20:42:57'),(68313,'Master of the Universe','http://niemann.blogs.nytimes.com/2009/07/14/master-of-the-universe/','Once you discover that you have the ability, using only household objects, to affect the outcome of elections and Super Bowls, you must use your power wisely. ',1,'2009-07-14 04:00:00','2012-06-04 20:42:57'),(68326,'Talk to the Newsroom: Assistant Managing Editor Michele McNally','http://www.nytimes.com/2009/06/22/business/media/22askthetimes.html','Michele McNally, who oversees photography, is answering questions from readers this week.',1,'2009-06-22 04:00:00','2012-06-04 20:42:59'),(68342,'Over the Wall','http://niemann.blogs.nytimes.com/2009/05/18/over-the-wall/','Working with woven paper, an artist examines his own history with the Berlin Wall. ',1,'2009-05-18 04:00:00','2012-06-04 20:43:02'),(68414,'Let Detroit Go Bankrupt','http://www.nytimes.com/2008/11/19/opinion/19romney.html','A managed bankruptcy may be the only path to the fundamental restructuring the auto industry needs.',1,'2008-11-19 05:00:00','2012-06-04 20:43:12');
